import './App.css';

function App() {
  return (
    <BrowserRouter>

     <Routes>
                <Route path='/signUp' element={<SignUp/>}></Route>
                <Route path='/' element={<SignIn/>}></Route>
                <Route path='/home' element={<Home/>}></Route>
    </Routes>
    </BrowserRouter>
  );
}

export default App;
